function CategoriesTable(probs){
    const data = probs.data;
    const columns = probs.column;
    // console.log(props);
    return (
        <div>
            <h1>Dynamic table</h1>
            <table className="table table-striped">
            <thead>
                <tr>
                {columns.map((item,index) =><TableHeadItem item={item} key={index}/>)}
                </tr>
            </thead>
            <tbody>
                
            </tbody>
            </table>
        </div>
    )
}
function TableHeadItem({probs}){
    <th>{probs.item.heading}</th>
    
}
export default CategoriesTable;
